package analysis.syntaxtree;import analysis.visitors.TypeVisitor;import analysis.visitors.Visitor;public class ClassDeclExtends implements ClassDecl {  public Identifier classId;  public Identifier baseClassId;  public VarDeclList fieldVarList;  public MethodDeclList methodList;  public ClassDeclExtends(Identifier ai, Identifier aj, VarDeclList avl, MethodDeclList aml) {    classId = ai;    baseClassId = aj;    fieldVarList = avl;    methodList = aml;  }  public void accept(Visitor v) {    v.visit(this);  }  public Type accept(TypeVisitor v) {    return v.visit(this);  }}